import React from 'react'
import ReactDOM from 'react-dom'


const Header = (props) => {
  return <h1> {props.name}</h1>
}

const Content = (props) => {
  return (
    <div>
      <Part name={props.parts[0].name} excercises={props.parts[0].exercises} />
      <Part name={props.parts[1].name} excercises={props.parts[1].exercises} />
      <Part name={props.parts[2].name} excercises={props.parts[2].exercises} />
    </div>
  )
}

const Part = (props) => {
  return (
    <p>
      {props.name} {props.exercises}
    </p>
  )
}

const Total = ({props}) => {
  return (
      <p>Number of exercises {props[0].exercises + props[1].exercises + props[2].exercises}</p>
  )
}


const App = () => {
  const course = {
    name: "Half Stack application development",
    parts: [
      {
        name: "Fundamentals of React",
        exercises: 10,
      },
      {
        name: "Using props to pass data",
        exercises: 7,
      },
      {
        name: "State of a component",
        exercises: 14,
      }
    ]
  }

  return (
    <div>
        <Header name = {course.name} />
        <Content parts = {course.parts} />

    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
